public String toString() {
  String res = "NULL";
  ForecastRecord rec = forecastRefEntry.get();
  if (rec != null) {
    res =  "rec.index = " + rec.myIndex + ", forecast t: " + rec.timeStamp +
        ", forecast: " + rec.forecast
        + ", sample: " + rec.sample + ", raw: " + rec.rawData + ", error: "
        + rec.sseError + ", alpha: " + rec.alpha;
  }
  return res;
}
